import { TestBed, fakeAsync, tick } from '@angular/core/testing';
import { DrawService } from './draw.service';

describe('DrawService', () => {
	let src =
		'data:image/png;base64,';
	let service: DrawService;
	let maxZoomIn = 5;
	let maxZoomOut = 2;
	let dusabled = false;
	let blur = 'none';
	let width = 500;
	let height = 500;
	let scale = 0.1;
	let container: HTMLElement;
	let image = document.createElement('img');
	image.src = src;

	function init(canvas: HTMLCanvasElement) {
		service.initialize(
			width,
			height,
			canvas,
			scale,
			container,
			src,
			maxZoomIn,
			maxZoomOut,
			dusabled,
			blur
		);
		fakeOnLoad();
	}

	function fakeOnLoad() {
		// it's becouse onload dosen't work in jasmine env
		service['intCanvas']();
		service['updateCanvas']();
	}

	beforeEach(async () => {
		await TestBed.configureTestingModule({
			providers: [DrawService],
		}).compileComponents();
	});

	beforeEach(async () => {
		service = TestBed.inject(DrawService);
	});

	it('should be created', () => {
		expect(service).toBeTruthy();
	});

	it('canvas should be init', () => {
		let canvas = document.createElement('canvas');
		init(canvas);
		expect(canvas.height).toBe(height);
		expect(canvas.width).toBe(width);
	});

	it('should be set width and height', () => {
		let canvas = document.createElement('canvas');
		init(canvas);
		const _height = 300;
		const _width = 300;
		service.setSize(_width, _height);
		expect(canvas.height).toBe(_height);
		expect(canvas.width).toBe(_width);
	});

	it('should be set filter', () => {
		const _blur = 'blur(4px)';
		let canvas = document.createElement('canvas');
		init(canvas);
		service.setBlur(_blur);
		const context = canvas.getContext('2d');
		expect(context.filter).toBe(_blur);
	});

	it('should allow zoom in', () => {
		let canvas = document.createElement('canvas');
		const context = canvas.getContext('2d');
		spyOn(context, 'drawImage').and.callThrough();
		init(canvas);
		service.zoomIn();

		expect(context.drawImage).toHaveBeenCalled();
	});

	it('should allow zoom out', () => {
		let canvas = document.createElement('canvas');
		const context = canvas.getContext('2d');
		spyOn(context, 'drawImage').and.callThrough();
		init(canvas);
		service.zoomOut();

		expect(context.drawImage).toHaveBeenCalled();
	});

	it('should recalculate negative dimentions', () => {
		let canvas = document.createElement('canvas');
		init(canvas);
		const _height = -1;
		const _width = -1;
		service.setSize(_width, _height);

		expect(canvas.height).not.toBe(_height);
		expect(canvas.width).not.toBe(_width);
	});
});
